import { useState, useEffect } from "react";
import axios from "axios";


function Pacients() {
  const [users, setUsers] = useState([]);
  useEffect(() => {
    axios.get("http://localhost:5000/api/users").then((response)=>{
          setUsers(response.data)
        })
  }, []);
  return (
    <div>
      <div>
        <input type="text" id="pacientSearch" placeholder="Search pacient " />
        <button type="button" class="btn btn-success">
          Search
        </button>
      </div>
      <div class="table-responsive">
        <table class="table">
          <thead>
            <tr>
              <th>First Name</th>
              <th>Last Name</th>
              <th>Email</th>
              <th>CNP</th>
            </tr>
          </thead>
          <tbody>
            {
                users.map((user) =>{
                    console.log(user)
                    return(
                        <tr>
                            <td>{user.name}</td>
                            <td>{user.lasttName}</td>
                            <td>{user.CNP}</td>
                            <td>{user.Email}</td>
                        </tr>
                        
                        
                    )
                })
            }
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default Pacients;
